import React from "react";
import styled from "styled-components";
import { Icon } from "./Icon";

export default function CollapsibleFilter({ handleToggleFilter }) {
  return (
    <FilterBox className="flex justify-between">
      <FilterName onClick={handleToggleFilter}>Browser</FilterName>
      <Icon
        path="./assets/images/downarrow.png"
        alt="down arrow"
        handleClick={handleToggleFilter}
      />
    </FilterBox>
  );
}

const FilterBox = styled.div`
  padding: 20px 5px 0 5px;
  border-top: 1px solid #e3e4e8;
`;

const FilterName = styled.p`
  color: #6b727d;
  font-size: 18px;
  font-weight: 500;
  cursor: pointer;
`;
